import React from 'react';
import { Link } from 'react-router-dom';
import { Container } from 'react-bootstrap';
//import Cabecalho from '../componentes/cabecalho';
//import CarouselBStrap from '../componentes/BScarousel';
import NavSc from '../componentes/navbar';
import Bootfooter from '../componentes/BSfooter';
import Carrocell from '../componentes/BScarrocell';

function Home() {
  return (

  
    
    <Container>
      <div style={{ 
      backgroundImage: `url("https://images.unsplash.com/photo-1437482078695-73f5ca6c96e2?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8cml2ZXJ8ZW58MHx8MHx8&w=1000&q=80")` 
      }}>

      <NavSc/>

      <Carrocell/>

      <Bootfooter/>

      </div>
    </Container>

      )
      };

export default Home;
